import React from 'react'
import { useNavigate } from 'react-router'

const Homepage = () => {
    const navigate = useNavigate();

    const handleUserButtonClick = () =>{
        navigate("/UserList");
    };
    const handleApptsButtonClick = () =>{
        navigate("/ListAppt");
    };

    return (
        <div className="items-center justify-center h-14 w-full my-4 space-x-4 pt-4">
        <button onClick={handleUserButtonClick} className="rounded text-white font-semibold bg-green-400 hover:bg-green-700 py-2 px-6">Users</button>
        <button onClick={handleApptsButtonClick} className="rounded text-white font-semibold bg-red-400 hover:bg-red-700 py-2 px-6">Appointments</button>
      </div>
    )
}

export default Homepage;
